def re_sort_number_image(origin_number: str) -> list:
    """
    返回一个排列好的svg base64代码列表
    :param origin_number:
    :return:
    """
    origin_b64_img_code = {
        '0': 'data:image/svg+xml;base64,',
        '1': 'data:image/svg+xml;base64,',
        '2': 'data:image/svg+xml;base64,',
        '3': 'data:image/svg+xml;base64,',
        '4': 'data:image/svg+xml;base64,',
        '5': 'data:image/svg+xml;base64,',
        '6': 'data:image/svg+xml;base64,',
        '7': 'data:image/svg+xml;base64,',
        '8': 'data:image/svg+xml;base64,',
        '9': 'data:image/svg+xml;base64,'}

    final_b64_img_code = []
    if origin_number != '0000000000':
        for i in origin_number:
            if i == '0':
                final_b64_img_code.append(origin_b64_img_code.get(str(i)))
            elif i == '1':
                final_b64_img_code.append(origin_b64_img_code.get(i))
            elif i == '2':
                final_b64_img_code.append(origin_b64_img_code.get(i))
            elif i == '3':
                final_b64_img_code.append(origin_b64_img_code.get(i))
            elif i == '4':
                final_b64_img_code.append(origin_b64_img_code.get(i))
            elif i == '5':
                final_b64_img_code.append(origin_b64_img_code.get(i))
            elif i == '6':
                final_b64_img_code.append(origin_b64_img_code.get(i))
            elif i == '7':
                final_b64_img_code.append(origin_b64_img_code.get(i))
            elif i == '8':
                final_b64_img_code.append(origin_b64_img_code.get(i))
            elif i == '9':
                final_b64_img_code.append(origin_b64_img_code.get(i))

        return final_b64_img_code
    else:
        for i in range(10):
            final_b64_img_code.append(origin_b64_img_code.get(str(0)))
        return final_b64_img_code
